import { useState } from "react"

export default function WineCard({ wine }) {


  return (

    <div className='wine__card'>
      <div>Winery: {wine.winery}</div>
      <div>Year: {wine.year}</div>
      <div>Grape: {wine.grape}</div>
      <div>Fruit: {wine.fruit} / 5</div>
      <div>Acidity: {wine.acidity} /5 </div>
      <div>Tannins: {wine.tannins} / 5</div>
      <div>Body: {wine.body} / 5</div>
      <div>Dominant Flavors: {wine.dominantFlavors.map(flavor => <div>{flavor}</div>)}</div>
      <div>Dominant Flavors: {wine.arrPossibleFlavors.map(flavor => <div>{flavor}</div>)}</div>
      {/* <div>PossibleFlavors Flavors: {possibleFlavors.map(flavor => <div>{flavor}</div>)}</div> */}
      <div>Overall Rating: {wine.overallRating}</div>
      {/* <button onClick={() => console.log(possibleFlavors)}>console log</button> */}
    </div>



  )
}
